import React from 'react';
import '../App.css';
import aliKuva from '../Kiasma.png';



const Who = () => {
   return ( 
      <div> 

         <img className='Port-img' src={aliKuva}/> 
         <h2 className= 'centered'>Who is she?</h2> 
         <p className= 'Port-basic'> Hi! I am Aliisa Palm
         but you may also call me Ali. I am a fourth-year student
         in Tampere university with a background of Electrical engineering. But </p>
         </div>
         )
}

export default Who
